import React from "react";
import {FilterButtons, RangButtons} from "../Buttons/Buttons";
import Footer from "../Footer/Footer";
import Navbar from "../Navbar/Navbar";

const Restaurant: React.FC=()=>{

    return(<>
        <Navbar />
        <FilterButtons name = "All"/>
        <FilterButtons name = "New"/>
        <FilterButtons name = "Most Popular"/>
        <FilterButtons name = "Open Now"/>
        <FilterButtons name = "Map View"/>
        <Footer />
    </>)

}

export default Restaurant
